import{_ as e,o as t,c as i,O as a}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 22.1-271.7 Public middle school student-athletes; pre-participation physical examination.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/22.1-271.7.md","filePath":"vacode/22.1-271.7.md"}'),o={name:"vacode/22.1-271.7.md"},n=a('<h1 id="§-22-1-271-7-public-middle-school-student-athletes-pre-participation-physical-examination" tabindex="-1">§ 22.1-271.7 Public middle school student-athletes; pre-participation physical examination. <a class="header-anchor" href="#§-22-1-271-7-public-middle-school-student-athletes-pre-participation-physical-examination" aria-label="Permalink to &quot;§ 22.1-271.7 Public middle school student-athletes; pre-participation physical examination.&quot;">​</a></h1><p>No public middle school student shall be a participant on or try out for any school athletic team or squad with a predetermined roster, regular practices, and scheduled competitions with other middle schools unless such student has submitted to the school principal a signed report from a licensed physician, a licensed nurse practitioner practicing in accordance with the provisions of § <a href="/vacode/54.1-2957/">54.1-2957</a>, or a licensed physician assistant acting under the supervision of a licensed physician attesting that such student has been examined, within the preceding 12 months, and found to be physically fit for athletic competition.</p><p>2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0692" target="_blank" rel="noreferrer">692</a>; 2018, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0776" target="_blank" rel="noreferrer">776</a>.</p>',3),s=[n];function c(r,l,d,p,h,u){return t(),i("div",null,s)}const f=e(o,[["render",c]]);export{m as __pageData,f as default};
